tm.x:
var $bm_rt;
var T, sIn, sOut, eIn, eOut;
$bm_rt = T = thisLayer;
if (T.marker.numKeys > 1 && numKeys > 3) {
    sIn = $bm_sub(key(2).time, key(1).time);
    sOut = $bm_sub(key(4).time, key(3).time);
    eIn = T.marker.key(1).time;
    $bm_rt = eOut = T.marker.key(2).time;
    if (time < T.marker.key(2).time)
        $bm_rt = linear(time, $bm_sub(eIn, sIn), eIn, key(1).value, key(2).value);
    else
        $bm_rt = linear(time, eOut, $bm_sum(eOut, sOut), key(3).value, key(4).value);
} else
    $bm_rt = value;

p.x:
var $bm_rt;
var x, y;
x = $bm_div(thisComp.width, 2);
y = $bm_div(thisComp.height, 2);
$bm_rt = [
    x,
    y
];

s.x:
var $bm_rt;
var x, y;
x = thisComp.width;
$bm_rt = y = thisComp.height;
if (x > y) {
    $bm_rt = $bm_div($bm_mul(value, x), 3840);
} else {
    $bm_rt = $bm_mul($bm_div($bm_mul(value, y), 2160), $bm_div(x, y));
}

var $bm_rt;
var temp;
temp = thisComp.layer('CONTROL').effect('Scale Control')(1);
$bm_rt = [
    temp,
    temp
];

var $bm_rt;
var temp;
temp = thisComp.layer('CONTROL').effect('Line Width')(1);
$bm_rt = [
    temp,
    100
];
